INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", 1, 100, 10142, "2030/12/17 14:59:59", 129901, 0.0, 7, 24, 10.85, 100, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", 1, 101, 10142, "2030/12/17 14:59:59", 129901, 0.0, 2, 24, 11.15, 101, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", 7, 102, 10142, "2030/12/17 14:59:59", 129901, 0.0, 5, 24, 6.4, 102, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", 3, 103, 10142, "2030/12/17 14:59:59", 129901, 0.0, 3, 24, 0.0, 103, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", 2, 104, 10142, "2030/12/17 14:59:59", 129901, 0.0, 8, 24, 2.43, 104, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", 4, 105, 10142, "2030/12/17 14:59:59", 129901, 0.0, 3, 24, 9.08, 105, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", 6, 106, 10142, "2030/12/17 14:59:59", 129901, 0.0, 6, 24, 0.0, 106, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", 3, 107, 10142, "2030/12/17 14:59:59", 129901, 0.0, 8, 24, 10.6, 107, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", 6, 108, 10142, "2030/12/17 14:59:59", 129901, 0.0, 4, 24, 7.54, 108, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", 2, 109, 10142, "2030/12/17 14:59:59", 129901, 0.0, 7, 24, 11.5, 109, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", 2, 110, 10142, "2030/12/17 14:59:59", 129901, 0.0, 1, 24, 8.83, 110, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", 1, 111, 10142, "2030/12/17 14:59:59", 129901, 0.0, 2, 24, 6.68, 111, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", 6, 112, 10142, "2030/12/17 14:59:59", 129901, 0.0, 2, 24, 8.8, 112, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", 2, 113, 10142, "2030/12/17 14:59:59", 129901, 0.0, 1, 24, 8.9, 113, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", 2, 114, 10142, "2030/12/17 14:59:59", 129901, 0.0, 5, 24, 3.7, 114, "エリコ", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", 1, 200, 10142, "2030/12/17 14:59:59", 129801, 0.0, 2, 24, 7.6, 200, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", 2, 201, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 2.25, 201, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", 2, 202, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 3.28, 202, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", 4, 203, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 2.98, 203, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", 4, 204, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 3.0, 204, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", 1, 205, 10142, "2030/12/17 14:59:59", 129801, 0.0, 2, 24, 10.3, 205, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", 6, 206, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 2.93, 206, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", 3, 207, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 9.3, 207, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", 4, 208, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 6.9, 208, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", 2, 209, 10142, "2030/12/17 14:59:59", 129801, 0.0, 2, 24, 0.0, 209, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", 1, 210, 10142, "2030/12/17 14:59:59", 129801, 0.0, 2, 24, 5.95, 210, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", 2, 211, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 6.73, 211, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", 2, 212, 10142, "2030/12/17 14:59:59", 129801, 0.0, 2, 24, 0.0, 212, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", 1, 213, 10142, "2030/12/17 14:59:59", 129801, 0.0, 2, 24, 6.65, 213, "マコト", 0.0);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES ("2024/03/31 12:00:00", "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", 6, 214, 10142, "2030/12/17 14:59:59", 129801, 0.0, 1, 24, 3.05, 214, "マコト", 0.0);
